social_posts.post_text:
Hopefully this reaches your algorithm because it’s truly important that we salute & celebrate our greats when we can. Tomorrow is the season finale of @cangottalent with one of the judges being our city’s own @kardinalo.. we’re both coming off a heavy birthday weekend (we’re twins) and now we’re getting the word out to our peers and supporters to tune in to the show! I rate this man beyond the music and our friendship. I’ve witnessed him champion for others to win.. I watched him big up Toronto when that wasn’t the cool thing to do.. and I’ve seen him represent our city & country for decades like a true real one from day.. and he’s from Scarborough. 🫡 so again, salute to My Celebrity Face on another incredible accolade and season with #cgt and here’s looking to another bunch of seasons to come. More success fam. More success. 

P.S if you don’t believe we’re twins, look at the last 2 slides and tell me if he took my boots or if I took his hat. 😂 

@theends.ca #theends Wear Where You’re From. 🔚
